from cheque c
inner join position_cheque pc on c.id_cheque = pc.id_cheque
inner join optica o on pc.id_optica = o.id_optica
where in_id_ch = c.id_cheque
group by pc.id_pc;
end$$

CREATE DEFINER=`root`@`%` PROCEDURE `sum_cheque` ()   BEGIN
    SELECT c.id_cheque, SUM(o.price), SUM(pc.quantity)
    FROM cheque c
    INNER JOIN position_cheque pc ON c.id_cheque = pc.id_cheque
    INNER JOIN optica o ON pc.id_optica = o.id_optica
    GROUP BY c.id_cheque;
END$$

